import React from "react";
import {
  Route,
  Routes,
} from "react-router-dom";
import Content from "../Content/Content";   

function RouterURL({CourseList , removeCourse , addCourse}) {
    return ( 
        <Routes >
            <Route exact path="/home" element={<Content CourseList = {CourseList} removeCourse = {removeCourse} addCourse = {addCourse}/>} />
        </Routes>
    );
}

export default RouterURL;
